import React from "react";
import Header from "./common/header"
import Tablelist from "./common/table"
import ConfirmedCase from './common/confirmedcase'

export default function Manage(props) {
    console.log(props.location.pathname.split('/')[1])
  return (
    <React.Fragment>
        <Header />

        {
            props.location.pathname.split('/')[1] === "confirmed-cases"?
                <ConfirmedCase {...props}/>
            :
                <Tablelist/>
        }
    </React.Fragment>
  );
}
